  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<re />} />
        <Route path="/password-reset" element={<PasswordReset />} />
        <Route path="/event/step-one" element={<StepOne />} />
        <Route path="/event/step-two" element={<StepTwo />} />
